(function ($, Drupal) {
    Drupal.behaviors.hkustBaseThemeBehavior = {
        attach: function (context, settings) {
            // top menu click
            $('.top-menu-list .top-item').mouseover(function (e) {
                if ($(this).is('.has-child')) {
                    $(this).find("i.fa-caret-down").removeClass('fa-caret-down').addClass('fa-caret-up');
                }
                var top_item_width = $(this).innerWidth();
                if ($(this).find(".submenu-list").length > 0) {
                    $(this).find(".submenu-list").width(top_item_width);
                }
                $(this).css({"background": '#00153F'});
                $(this).stop().find(".submenu-list").show();
            }).mouseout(function () {
                $(this).css({"background": '#003366'});
                $(this).find("i.fa-caret-up").removeClass('fa-caret-up').addClass('fa-caret-down');
                $(this).stop().find(".submenu-list").hide();
            });

            // switch language
            $('.site-header-content .switch-language').mouseover(function () {
                var wid = $(this).parents('.search').width();
                $(this).css({"background": '#00153F'});
                $(this).find("i.fa-caret-down").removeClass('fa-caret-down').addClass('fa-caret-up');
                $(this).find(".language").width(wid);
                $(this).find(".language").show();
            }).mouseout(function () {
                $(this).css({"background": '#003366'});
                $(this).find("i.fa-caret-up").removeClass('fa-caret-up').addClass('fa-caret-down');
                $(this).find(".language").hide();
            });

            //custom block anchor
            var _3imageWithLinksBlock = $('.global-connection-style .paragraph--type--global-connection')
            _3imageWithLinksBlock.each(function () {
                var _3imageWithLinksImage = $(this).find('.special-anchor');
                var _3imageWithLinksAnchorName = $(this).find('.field--name-field-anchor-name');
                _3imageWithLinksImage.attr('name', _3imageWithLinksAnchorName.text())
            });

            //href anchor
            function anchor() {
                if (window.location.hash) {
                    var anchor = window.location.hash
                    var anchor_name = anchor.substring(1);
                    var getHeaderHeight = $(window).outerWidth();
                    var getHeaderNavHeight = 0;
                    if (getHeaderHeight > 1348) {
                        getHeaderNavHeight = $(".header-data-pc").height();
                    } else {
                        getHeaderNavHeight = $(".header-data-mobile").height();
                    }
                    if ($("*[name=" + anchor_name + "]").length > 0) {
                        TweenLite.to(window, 1, {
                            scrollTo: {
                                y: "*[name=" + anchor_name + "]",
                                offsetY: getHeaderNavHeight
                            }
                        });
                    }
                }
            }

            //window on load run ones
            anchor();

            $('.menu-lists li.sub-item,.header-data-mobile .menu-lists li a.sub-item').click(function () {
                setTimeout(function () {
                    anchor()
                }, 300)

            })


            //main menu hover
            $('.main-menu .menu-lists .parent-item').mouseover(function () {
                $(this).find(".sub-menu").dequeue().stop(true, true).show();
            }).mouseout(function () {
                $(this).find(".sub-menu").dequeue().stop(true, true).hide();
            });

            // main menu submenu hover main menu background
            $('.main-menu .menu-lists .parent-item .sub-menu .sub-item').mouseover(function () {

                $(this).parent().siblings('.has-sub-menu').addClass('selected-sub-item');
            }).mouseout(function () {
                $(this).parent().siblings('.has-sub-menu').removeClass('selected-sub-item');
            });


            //mobile menu toggle
            $(".header-data-mobile .menu .menus-bar").click(function () {
                var curr_screen_height = $(window).height();
                var mobile_menu_all = $(".header-data-mobile");

                //remember gradient status
                var mobile_menu_is_gradient = mobile_menu_all.find('.content').hasClass('gradient-bg');

                //top bar
                var mobile_top_bar_h = mobile_menu_all.find('.space').outerHeight();

                //center
                var mobile_menu_center = mobile_menu_all.find('.content');
                var mobile_menu_center_h = mobile_menu_center.outerHeight();

                //menu list
                var mobile_menu = mobile_menu_all.find('.menu-lists');
                var mobile_menu_h = mobile_menu.outerHeight();


                if (curr_screen_height > mobile_menu_h) {
                    var set_mobile_h = mobile_menu_h;
                } else {
                    var set_mobile_h = curr_screen_height - mobile_top_bar_h - mobile_menu_center_h;
                }

                //show menu
                if (mobile_menu.css('visibility') == 'hidden') {
                    $(this).addClass("is_show");
                    $(".header-data-mobile .content .menu .search .fa-search").addClass("fa-search-hidden");
                    $(this).find('i.fa-bars').removeClass('fa-bars').addClass('fa-times');
                    if (mobile_menu_center.hasClass('gradient-bg')) {
                        mobile_menu_center.removeClass("gradient-bg")
                    }
                    $("body").addClass('stop-scroll');
                    mobile_menu.css({'overflow-y': 'auto', 'height': set_mobile_h, 'visibility': "visible"});

                    $(window).resize(function () {
                        var windowWidth = $(window).width();

                        if (windowWidth >= 1348) {
                            $(".header-data-mobile .menu .menus-bar").removeClass("is_show");
                            $(".header-data-mobile .content .menu .search .fa-search").removeClass("fa-search-hidden");
                            $(".header-data-mobile .menu .menus-bar").find('i.fa-times').removeClass('fa-times').addClass('fa-bars');
                            if (!mobile_menu_is_gradient) {
                                mobile_menu_center.addClass("gradient-bg")
                            }
                            $("body").removeClass('stop-scroll');
                            mobile_menu.css({
                                'overflow-y': 'visible',
                                'height': mobile_menu_h,
                                'visibility': "hidden",
                            });
                        }
                    });

                } else {
                    $(this).removeClass("is_show");
                    $(".header-data-mobile .content .menu .search .fa-search").removeClass("fa-search-hidden");
                    $(this).find('i.fa-times').removeClass('fa-times').addClass('fa-bars');
                    if (!mobile_menu_is_gradient) {
                        mobile_menu_center.addClass("gradient-bg")
                    }
                    $("body").removeClass('stop-scroll');
                    mobile_menu.css({'overflow-y': 'visible', 'height': mobile_menu_h, 'visibility': "hidden"});
                }

            })

            // mobile sub menu click
            $(".header-data-mobile .menu-lists .has-sub-menu span").click(function (e) {
                e.preventDefault();
                if ($(this).parent().siblings('.sub-menu').is(':hidden')) {
                    $(this).parent().addClass("is_show_sub");
                    $(this).find("i").removeClass("fa-caret-down").addClass("fa-sort-up");
                    $(this).parent().siblings('.sub-menu').stop().show();
                    $(this).closest('li').siblings('li').find('span i').addClass("fa-caret-down").removeClass("fa-sort-up");
                    var scroolTopH = $(this).parent().parent().index() * 42;
                    // $(this).parent().parent().parent().scrollTop(scroolTopH)
                    $(this).parent().parent().parent().animate({scrollTop: scroolTopH}, 'slow');
                    //hide other
                    $(this).parent().parent().siblings("li").find(".sub-menu").hide()
                    $(this).parent().parent().siblings("li").find(".has-sub-menu").removeClass("is_show_sub")
                    $(this).parent().parent().siblings("li").find(".span i").addClass("fa-caret-down").removeClass("fa-sort-up");


                }
                else {
                    $(this).parent().removeClass("is_show_sub");
                    $(this).find("i").addClass("fa-caret-down").removeClass("fa-sort-up");
                    $(this).parent().siblings('.sub-menu').stop().hide();
                }
            });

            // Initial size.
            var size = 'normal';

            // Store the original font sizes for each element. Might be slow
            // though.
            var elements = [];
            $('#main-content-region').find(':not(.block-explore-block)').each(function () {
                elements.push({
                    elem: this,
                    fontSize: parseInt($(this).css('font-size')),
                })
            })

            //large size
            $(".site-font-size.large-size,.fonts .large-size").on("click", function (e) {
                e.preventDefault();

                if (size !== 'large') {
                    resizeFonts(elements, 'large');
                    size = 'large';
                }
            });

            //small size
            $(".site-font-size.small-size,.fonts .small-size").on("click", function (e) {
                e.preventDefault();

                if (size !== 'small') {
                    resizeFonts(elements, 'small');
                    size = 'small';
                }
            });

            $(".site-font-size.normal-size,.fonts .normal-size").on("click", function (e) {
                e.preventDefault();

                if (size !== 'normal') {
                    resizeFonts(elements, 'normal');
                    size = 'normal';
                }
            });

            /**
             * Resize fonts.
             */
            function resizeFonts(elements, size) {
                $.each(elements, function (index, value) {
                    if (size === 'normal') {
                        $(value.elem).css('font-size', '');
                        return;
                    }

                    var fontSize = value.fontSize;

                    switch (size) {
                        case 'large':
                            fontSize += 2;
                            break;

                        case 'small':
                            fontSize -= 2;
                            break;
                    }

                    $(value.elem).css('font-size', fontSize + 'px');
                });
            }

            //tab trigger hover effect
            var lastTarget = null;
            $('*').on('focus', function () {
                if (lastTarget && lastTarget.length) {
                    lastTarget.trigger("mouseleave");
                }
                $(this).trigger("mouseenter");
                lastTarget = $(this);
            });

            //detect browser language
            $(document).ready(function () {
                //click language
                $('.switch-language a').click(function (e) {
                    e.preventDefault();
                    var switchLangCode = $(this).attr('data-language');
                    if (switchLangCode == '') {
                        return false;
                    }
                    $.cookie('switch_lang', switchLangCode, {expires: 30, path: '/'});
                    window.location.href = $(this).attr('href');
                });

                //check language in url
                var curr_url = window.location.pathname;
                if (curr_url.indexOf(drupalSettings.language) > -1) {
                    $.cookie('switch_lang', drupalSettings.language, {expires: 30, path: '/'});
                }


                if (drupalSettings.language == 'en' && drupalSettings.is_front_page == true && $.cookie('switch_lang') != 'en') {
                    if ($("link[hreflang=" + $.cookie('switch_lang') + "]").length > 0) {
                        var url = $("link[hreflang=" + $.cookie('switch_lang') + "]").attr('href');
                        if (url.substr(-13) == '/zh-hant/home') {
                            url = '/zh-hant';
                        }
                        if (url.substr(-13) == '/zh-hans/home') {
                            url = '/zh-hans';
                        }
                        url = url.replace('/home?', '?');
                        window.location.href = url;
                    }
                }
            });

            //active menu bold
            var desMenu = $('.header-data-pc #main-menu .menu');
            var menuParentItem = desMenu.find('.menu-lists .parent-item');
            var curr_Path = window.location.pathname;
            var hostName = window.location.hostname;
            var combinedCurrUrl = hostName + curr_Path;
            menuParentItem.each(function () {
                var menuParentLink = $(this).find('>a').attr('href');
                var combinedMenuUrl = hostName + menuParentLink;
                if (combinedCurrUrl.startsWith(combinedMenuUrl)) {
                    $(this).find('>a').css('font-weight', '900');
                }
            });
        }
    }
})(jQuery, Drupal)
;
(function ($, Drupal) {
    Drupal.behaviors.hkustFooterBehavior = {
        attach: function (context, settings) {

            $(document).ready(function () {
                if (typeof localStorage.AcceptCookieInfo === 'undefined') {
                    localStorage.setItem("AcceptCookieInfo","no");
                }

                if(localStorage.getItem('AcceptCookieInfo') == 'no'){
                    $(".cookieinfo").show()
                }

                $(".cookieinfo .cookieinfo-accept").click(function () {
                    localStorage.setItem("AcceptCookieInfo","yes")
                    $(".cookieinfo").hide();
                })

                $(".cookieinfo .cookieinfo-close").click(function () {
                    $(".cookieinfo").hide();
                })
            });



            //btn scroll top
            $(window).scroll(function () {
                if ($(window).scrollTop() > $('body').height() / 3) {
                    $('#btn-back-to-top .click-to-top').show();
                }else{
                    $('#btn-back-to-top .click-to-top').hide();
                }
            });

            $("#btn-back-to-top .click-to-top").click(function() {
                $("html, body").animate({ scrollTop: 0 }, "slow");
                return false;
            });
        }
    }
})(jQuery, Drupal);
