(function ($, Drupal) {
    Drupal.behaviors.SiteSearchBlock = {
        attach: function (context, settings) {

            // $(window).resize(function(){
            // pc ver.
            var pcSearchBlock = $(".header-data-pc #header .site-header-content .right .search .search-font");
            var pcSearchButton = $(pcSearchBlock).find("i.fa-search");
            var pcHeaderMenu = $(".header-data-pc .main-menu");
            var pcVerSearchBlock = $(".block.block-hkust-main-signature.block-site-search-block .pc-header");
            var headerLogo = $(".header-data-pc #main-menu .main-menu .site-logo img.destop-logo");
            var headerLogoTranslate = $(".header-data-pc #main-menu .main-menu .site-logo img.destop-logo-translate");

            var mobileSearchButton = $(".header-data-mobile .content .menu .search .fa-search");
            var mobileMenu = $(".header-data-mobile .content .menu .menus-bar");
            var moblieVerSearchBlock = $(".block.block-hkust-main-signature.block-site-search-block .mobile-header");
            var removeGardient = $(".header-data-mobile .content");

            var pc_menu_is_gradient = $(".header-data-pc").hasClass('fade-bg');

            $(pcSearchBlock).click(function (e) {
                e.stopImmediatePropagation();
                if ($(pcVerSearchBlock).is(":hidden")) {
                    $(pcVerSearchBlock).addClass('show');
                    $(moblieVerSearchBlock).addClass('hide');

                    if (pc_menu_is_gradient) {
                        $('.header-data-pc').removeClass('fade-bg');
                    }

                    bodyScrollLock.disableBodyScroll($(pcVerSearchBlock));
                    //turn background dark
                    $(pcHeaderMenu).addClass('dark');
                    //close button background turn white
                    $(pcSearchBlock).addClass("close-button-background");
                    //replace the old button
                    $(pcSearchButton).addClass("fa-times");
                    //replace background logo
                    $(headerLogo).hide();
                    $(headerLogoTranslate).show();

                    $(window).resize(function () {
                        var windowWidth = $(window).width();

                        if (windowWidth <= 1348) {
                            $(pcVerSearchBlock).removeClass('show');
                            $('.header-data-pc').addClass('fade-bg');
                            $(removeGardient).addClass('gradient-bg');
                            bodyScrollLock.clearAllBodyScrollLocks();
                            $(pcHeaderMenu).removeClass('dark');
                            $(pcSearchBlock).removeClass("close-button-background");
                            $(pcSearchButton).removeClass("fa-times");
                            $(headerLogo).show();
                            $(headerLogoTranslate).hide();
                        }
                    });
                } else {
                    $(pcVerSearchBlock).removeClass('show');
                    if (pc_menu_is_gradient) {
                        $('.header-data-pc').addClass('fade-bg');
                    }
                    bodyScrollLock.clearAllBodyScrollLocks();
                    $(pcHeaderMenu).removeClass('dark');
                    $(pcSearchBlock).removeClass("close-button-background");
                    $(pcSearchButton).removeClass("fa-times");
                    $(headerLogo).show();
                    $(headerLogoTranslate).hide();
                }

            });

            // mobile ver.
            // check orientation status
            window.addEventListener("orientationchange", function () {
                if (!$(moblieVerSearchBlock).is(":hidden")) {
                    setTimeout(function () {
                        $(removeGardient).removeClass("gradient-bg");
                    }, 500);
                }
            }, false);

            $(mobileSearchButton).click(function (e) {
                e.stopImmediatePropagation();
                if ($(moblieVerSearchBlock).is(":hidden")) {
                    bodyScrollLock.disableBodyScroll($(moblieVerSearchBlock));
                    $(moblieVerSearchBlock).addClass('show');
                    //replace old button
                    $(mobileSearchButton).addClass("fa-times");
                    //hidden search button
                    $(mobileMenu).addClass("no-show-button");
                    //remove background gardient
                    $(removeGardient).removeClass("gradient-bg");

                    $(window).resize(function () {
                        var windowWidth = $(window).width();
                        if (windowWidth > 1348) {
                            $(moblieVerSearchBlock).removeClass('show');
                            bodyScrollLock.clearAllBodyScrollLocks();
                            $(mobileSearchButton).removeClass("fa-times");
                            $(mobileMenu).removeClass("no-show-button");
                            $(removeGardient).addClass("gradient-bg");
                        }
                    });

                } else {
                    $(moblieVerSearchBlock).removeClass('show');
                    bodyScrollLock.clearAllBodyScrollLocks();
                    $(mobileSearchButton).removeClass("fa-times");
                    $(mobileMenu).removeClass("no-show-button");
                    $(removeGardient).addClass("gradient-bg");
                }

            });
        }
    };
})(jQuery, Drupal);;
(function ($, window, Drupal, drupalSettings) {

    Drupal.behaviors.hkust_enhancements_news = {
        attach: function attach(context, settings) {

            if ($('.view-display-id-home_page_news, .view-display-id-news_internal').length) {
                $('.view-display-id-home_page_news .is-video .left-content a, .view-display-id-news_internal .is-video .left-content a, .is-video .more-stories-img a').each (function() {
                    $(this).attr('data-fancybox', ' ');
                    if ($(this).attr('href').includes('iframe')) {
                      $(this).attr('data-type', 'iframe');
                    }
                    if ($(this).attr('href').includes('youku')) {
                      $(this).attr('data-type', 'iframe');
                    }
                      $(this).attr('target', '_blank');
                    /*$(this).on('click', function(i,e) {
                      e.preventDefault();
                      //window.open($(this).attr('href'),'_blank');
                      })*/
                })
            }

            if ($(".mfp-field.mfp-all-items").length) {
                // $(".mfp-field.mfp-all-items").find('.field__item').addClass('slick-slide');
                if ($('.mfp-field.mfp-all-items .field__item').length > 2) {
                  $(".mfp-field.mfp-all-items").slick({
                      slidesToShow   : 1,
                      autoplay: true,
                      autoplaySpeed: 5000,
                      centerMode: true,
                      variableWidth: true,
                      infinite : true,
                      responsive: [
                        {
                          breakpoint: 767,
                          settings: {
                            slidesToShow: 1,
                            slidesToScroll: 1,
                            infinite: true,
                          }
                        }
                      ]
                  });
                }
                $('.slick-slide a').css('outline', 'none');
            }

            if ($(".news-article-content").length) {
              $('.news-article-content .field--name-body img').each(function() {
                var image = $(this).attr('src');
                $(this).wrap('<a class="lightbox-image" href="'+image+'" />');
              }).promise().done(function() {
                $('a.lightbox-image').magnificPopup({
                  type:'image',
                  zoom: {
                    enabled: true,
                    duration: 300,
                    easing: 'ease-in-out'
                  }
                });
              });
            }
        }
    }
})(jQuery, window, Drupal, drupalSettings);
