(function ($, Drupal, window, document, undefined) {
1
    Drupal.behaviors.wca = {
        attach: function (context, settings) {
            fix_wca();
        }
    };

    function a11ylink(selector, wrapInner = false) {
      if (!$(selector).find('.ally-link').length) {
        if (wrapInner) {
          var color = $(selector).css('color');
          $(selector).wrapInner('<a tabindex="0" class="a11y-link"></a>');
          $(selector).find('.a11y-link').css('color', color);
        }
        else {
          var color = $(selector).css('color');
          $(selector).wrap('<a tabindex="0" class="a11y-link"></a>');
          $(selector).find('.a11y-link').css('color', color);
        }
      }
    }
    function a11ylinkactivate() {
      $('#btn-back-to-top').unbind('keypress').on('keypress', function() {
        $(this).find('*').first().trigger('click').trigger('mouseover');
      });
      $('.a11y-link').unbind('keypress').on('keypress', function() {
        if ($(this).find('em').length) {
          $(this).find('em').trigger('click').trigger('mouseover');
        }
        else {
          $(this).find('*').first().trigger('click').trigger('mouseover');
        }
      });
    }
    function fix_wca() {
        //SOCIAL MEDIA
        if ($('.social-media-content').length) {
            $('.social-media-content').find('.wechat_qrcode img').attr('alt', 'WECHAT QR Code');
        }
        $('#cboxPrevious').text('previous');
        $('#cboxNext').text('next');
        $('#cboxSlideshow').text('slideshow');
        // search form
        if ($('#block-sitesearchblock').length) {
            $('#block-sitesearchblock').find('form').each(function() {
                if ($(this).find('.wca-js').length) {
                    return;
                }
                $(this).find('.rd').addClass('wca-js').wrap('<fieldset>');
                var title = 'Please select a category: ';
                $(this).find('fieldset').prepend('<legend style="color:#fff;font-size:15px">' + title + '</legend>');
            });
        }
        // page top notification
        setTimeout(function() {
          if (!$('.close-btn').find('.a11y-link').length) {
            $('.close-btn').wrapInner('<a tabindex="0" class="a11y-link" style="color:#000"></a>');
            a11ylinkactivate();
          }
        }, 2000);
        // faq
        a11ylink('.view-faq .form-item-field-faq-section-value label');
        a11ylink('.view-faq .views-field-title');
        // awards filter
        a11ylink('.widget--awards-type .option');
        a11ylink('.widget--awards-year .swiper-container .option .label');
        // cookie consent
        a11ylink('.cookieinfo-accept');
        a11ylink('.cookieinfo-close');

        // live chat
        $('.sc-widget').attr('alt', 'Live Chat');
        a11ylink('#chat-widget img');
        $('.sc-header--img').on('click', function() {
          a11ylink('#chat-widget img');
          a11ylinkactivate();
        });

        if (!$('.menus-bar').find('.a11y-link').length) {
          $('.menus-bar').wrap('<a tabindex="0" class="a11y-link" style="color:#000"></a>');
        }
        // font selectors
        a11ylink('.font .small-size');
        a11ylink('.font .normal-size');
        a11ylink('.font .large-size');
        // slick buttons
        a11ylink('.slick-prev', true);
        a11ylink('.slick-next', true);

        // language switcher
        a11ylink('.switch-language');
        // news filters
        a11ylink('.news-button.news-button__subscribe');
        a11ylink('.news-button.news-button__search');

        // search form
        if (!$('.menu .search').find('.a11y-link').length) {
          $('.menu .search').wrap('<a tabindex="0" class="a11y-link" style="color:#000"></a>');
        }

        // main menu
        if ($('.header-menu-wrapper').length) {
          $('.header-menu-wrapper .has-sub-menu').each(function() {
            if (!$(this).find('em').find('.a11y-link').length) {
              $(this).find('em').wrap('<a tabindex="0" class="a11y-link" style="color:#000"></a>');
            }
          });
        }
        a11ylinkactivate();

        if ($('input[type=radio]').length) {
            var k = 0;
            $('input[type=radio]').each (function() {
                var label = $(this).next('label');
                if (label.attr('for') == undefined) {
                    var id = $(this).attr('id');
                    if (id == undefined) {
                        var v = $(this).attr('value');
                        id = 'radio' + (k++) + '-' + v;
                        label.attr('for', id);
                        $(this).attr('id', id);
                    }
                }
            })
        }
    }


    $(document).ready(function() {
      fix_wca();
    });

})(jQuery, Drupal, this, this.document);
;
